import React, { useState } from "react";
import ResumeCard from "../ResumeCard/resumeCard";
import ProfessionalSkillComponent from "../Pages/proffesional_skill";

const PortfolioTab = () => {
  const [activeTab, setActiveTab] = useState("Education");

  const handleTabChange = (tabName) => {
    setActiveTab(tabName);
  };

  return (
    <div className="w-[1400px] h-full text-center items-center bg-[#F7F7F7] text-black">
      <div class="tab bg-[#F7F7F7] card_shadow mb-4 text-black text-[16px] justify-left flex w-full h-full text-center items-left  flex flex-center items-center ">
        <button
          className={`tablinks ${activeTab === "All" ? "active" : ""}`}
          onClick={() => handleTabChange("All")}
          style={{
            padding: "20px 30px",
            height: "75px",
            width: "fit-content",
            margin: "auto",
          }}
        >
          <span className="text-[#999999]">All</span>
        </button>

        <button
          className={`tablinks ${
            activeTab === "BRAND IDENTITY" ? "active" : ""
          }`}
          onClick={() => handleTabChange("BRAND IDENTITY")}
          style={{
            padding: "20px 30px",
            height: "75px",
            width: "fit-content",
            margin: "auto",
          }}
        >
          <span className="text-[#999999]">BRAND IDENTITY</span>
        </button>

        <button
          className={`tablinks ${activeTab === "CALENDAR" ? "active" : ""}`}
          onClick={() => handleTabChange("CALENDAR")}
          style={{
            padding: "20px 30px",
            height: "75px",
            width: "fit-content",
            margin: "auto",
          }}
        >
          <span className="text-[#999999]">CALENDAR</span>
        </button>

        <button
          className={`tablinks ${activeTab === "CAMPAIGNS" ? "active" : ""}`}
          onClick={() => handleTabChange("CAMPAIGNS")}
          style={{
            padding: "20px 30px",
            height: "75px",
            width: "fit-content",
            margin: "auto",
          }}
        >
          <span className="text-[#999999]">CAMPAIGNS</span>
        </button>
        <button
          className={`tablinks ${activeTab === "LOGO DESIGNS" ? "active" : ""}`}
          onClick={() => handleTabChange("LOGO DESIGNS")}
          style={{
            padding: "20px 30px",
            height: "75px",
            width: "fit-content",
            margin: "auto",
          }}
        >
          <span className="text-[#999999]">LOGO DESIGNS</span>
        </button>
        <button
          className={`tablinks ${activeTab === "MOBILE APPS" ? "active" : ""}`}
          onClick={() => handleTabChange("MOBILE APPS")}
          style={{
            padding: "20px 30px",
            height: "75px",
            width: "fit-content",
            margin: "auto",
          }}
        >
          <span className="text-[#999999]">MOBILE APPS</span>
        </button>
        <button
          className={`tablinks ${activeTab === "MOBILE APPS" ? "active" : ""}`}
          onClick={() => handleTabChange("MOBILE APPS")}
          style={{
            padding: "20px 30px",
            height: "75px",
            width: "fit-content",
            margin: "auto",
          }}
        >
          <span className="text-[#999999]">PACKAGING</span>
        </button>
        <button
          className={`tablinks ${activeTab === "MOBILE APPS" ? "active" : ""}`}
          onClick={() => handleTabChange("MOBILE APPS")}
          style={{
            padding: "20px 30px",
            height: "75px",
            width: "fit-content",
            margin: "auto",
          }}
        >
          <span className="text-[#999999]">WEBSITES</span>
        </button>
      </div>

      <div
        id="ALL"
        className="tabcontent grid grid-cols-1 sm:grid-cols-2"
        style={{ display: activeTab === "Education" ? "grid" : "none" }}
      >
        <div className="flex flex-col ml-8 text-left">
          <span className="text-[#FF004F] text-[14px]">2007-2010</span>
          <h2 className="text-[20px] mt-2 font-[500] leading-[24px]">
            Education Quality
          </h2>
        </div>
        <div className="flex flex-col mt-2 ml-8 text-left">
          <span className="text-[#FF004F] text-[14px]">2007-2010</span>
          <h2 className="text-[20px] font-[500] leading-[24px]">
            Job Experience
          </h2>
        </div>

        {educaton_data.map((data, index) => (
          <ResumeCard
            key={index}
            title={data.title}
            gpa={data.gpa}
            duration={data.duration}
            desc={data.desc}
          />
        ))}
      </div>

      <div
        id="Experience"
        className="tabcontent grid grid-cols-1 sm:grid-cols-2 gap-8"
        style={{ display: activeTab === "Experience" ? "grid" : "none" }}
      >
        {job_experience_data.map((data, index) => (
          <ResumeCard
            key={index}
            title={data.title}
            gpa={data.gpa}
            duration={data.duration}
            desc={data.desc}
          />
        ))}
      </div>

      <div
        id="Professional Skills"
        className="tabcontent flex  max-h-[fit-content] h-full"
        style={{
          display: activeTab === "Professional Skills" ? "flex" : "none",
        }}
      >
        <ProfessionalSkillComponent />
      </div>

      <div
        id="Interview"
        className="tabcontent flex"
        style={{
          display: activeTab === "Interview" ? "grid" : "none",
        }}
      >
        <div className="flex flex-col ">
          <div className="flex justify-between">
            <div className="flex flex-col">
              <span className="text-[#FF004F]">Fearture</span>
              <h1 className="text-black text-[16px]"> Design Skill </h1>
            </div>
            <div className="flex flex-col">
              <span className="text-[#FF004F]">Fearture</span>
              <h1> Development Skill </h1>
            </div>
          </div>

          <div className="grid grid-cols-1 sm:grid-cols-2 gap-8">
            <div>
              <span className="bg-"></span>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default PortfolioTab;
